#include <iostream>
#include <string>

using namespace std;


class Solution {
public:
    string shortestPalindrome(string s) {
        int i = 0; 
        int j = s.size() - 1;
        while(j >= 0)
        {
        	int cnt = isPalindrome(s, i, j);
        	if(cnt == 0)
        	{
        		string tmp(s.rbegin(), s.rbegin()+s.size()-j-1);
        		return tmp + s;
        	}
        	j -= cnt;
        }

        return s;
    }

    int isPalindrome(const string & s, int i, int j)
    {
    	while(j > i && s[j] == s[i])
    	{
    		j--;
    		i++;
    	}

    	int cnt = 0;
    	while(j > i)
    	{
    		cnt++;
    		j--;
    		if(s[i] == s[j])
    			break;
    	}

    	return cnt;
    }
};

int main()
{
	Solution sol;
	cout << sol.shortestPalindrome("");
	return 0;
}